import React, { useState } from "react";
import { 
    ArrowLeft, 
    Play, 
    Clock, 
    CheckCircle, 
    AlertCircle, 
    Coins,
    TrendingUp,
    DollarSign,
    Activity,
    Target,
    Zap
} from "lucide-react";

const StrategyDetailView = ({ strategy, onBack, onRequestRecommendation }) => {
    const [isProcessing, setIsProcessing] = useState(false);
    const [processSteps, setProcessSteps] = useState([
        { 
            id: 1, 
            name: "Market Screening", 
            status: "pending", 
            description: "Analyzing market conditions and trends",
            timestamp: null
        },
        { 
            id: 2, 
            name: "Quantitative Analysis", 
            status: "pending", 
            description: "Running mathematical models and calculations",
            timestamp: null
        },
        { 
            id: 3, 
            name: "Qualitative Due Diligence", 
            status: "pending", 
            description: "Evaluating fundamental factors and news",
            timestamp: null
        },
        { 
            id: 4, 
            name: "Investment Committee Review", 
            status: "pending", 
            description: "Final review and recommendation generation",
            timestamp: null
        }
    ]);

    const [agentOutputs, setAgentOutputs] = useState([
        {
            id: 1,
            name: "Market Screener Agent",
            status: "pending",
            output: "",
            timestamp: null
        },
        {
            id: 2,
            name: "Quantitative Analysis Agent",
            status: "pending",
            output: "",
            timestamp: null
        },
        {
            id: 3,
            name: "Qualitative Due Diligence Agent",
            status: "pending",
            output: "",
            timestamp: null
        },
        {
            id: 4,
            name: "Investment Committee Agent",
            status: "pending",
            output: "",
            timestamp: null
        }
    ]);

    const [finalRecommendation, setFinalRecommendation] = useState(null);

    const handleRequestRecommendation = async () => {
        setIsProcessing(true);
        setFinalRecommendation(null);

        // Sample outputs for each agent (for demo purposes)
        const sampleOutputs = [
            {
                output: `📊 Market Analysis for ${strategy.coin}:

• Current Price: $45,230 (+2.3% 24h)
• Market Cap: $845B (Rank #1)
• Trading Volume: $23.4B (24h)
• RSI: 58.2 (Neutral)
• Moving Averages: Bullish crossover detected
• Support Level: $43,500
• Resistance Level: $47,800

🔍 Technical Indicators:
- MACD: Bullish divergence
- Bollinger Bands: Mid-range, trending up
- Volume Profile: Above average
- Market Sentiment: 68% Bullish

📈 Short-term outlook appears positive with strong support levels maintained.`
            },
            {
                output: `🧮 Quantitative Analysis Results:

📊 Risk Metrics:
• Sharpe Ratio: 1.42 (Good)
• Volatility: 3.8% (Daily)
• Beta: 1.15 vs market
• VaR (95%): -$1,850
• Maximum Drawdown: 12.3%

💹 Performance Indicators:
• 7-day return: +5.2%
• 30-day return: +12.8%
• Correlation with BTC: 0.78
• Alpha: 0.24

🎯 Price Targets:
• Conservative: $47,500 (5% upside)
• Moderate: $50,200 (11% upside)
• Aggressive: $52,800 (17% upside)

⚠️ Risk Score: 6/10 (Moderate)
Expected return over 30 days: 8-15%`
            },
            {
                output: `📋 Fundamental Analysis:

🏢 Project Fundamentals:
• Network activity: +18% increase in transactions
• Developer activity: 245 commits this month
• Partnership announcements: 3 major deals
• Regulatory environment: Favorable
• Adoption metrics: Growing institutional interest

📰 News Sentiment Analysis:
• Positive: 72%
• Neutral: 21%
• Negative: 7%

🔍 Key Events:
• Q3 earnings report: Above expectations
• New feature launch: Successfully deployed
• Exchange listings: 2 new tier-1 exchanges
• Whale activity: Accumulation phase detected

💡 Fundamental Score: 8.2/10
Strong fundamentals support continued growth trajectory.`
            },
            {
                output: `🏛️ Investment Committee Final Review:

✅ Recommendation: BUY
🎯 Confidence Level: 82%
💰 Suggested Position Size: 15% of portfolio
⏰ Time Horizon: 3-6 months

📊 Committee Analysis:
• Technical Analysis: Bullish (4/5 votes)
• Fundamental Analysis: Strong Buy (5/5 votes)
• Risk Assessment: Acceptable (4/5 votes)
• Market Timing: Good entry point (4/5 votes)

🎯 Action Plan:
1. Enter position at current levels
2. Set stop-loss at $42,000 (-7%)
3. Take profits at $50,000 (+10%)
4. Monitor key support/resistance levels

⚖️ Risk/Reward Ratio: 1:1.43 (Favorable)
Expected holding period: 90-180 days`
            }
        ];

        // Simulate the process steps and agent outputs
        for (let i = 0; i < processSteps.length; i++) {
            setTimeout(() => {
                // Start processing step
                setProcessSteps(prev => prev.map((step, index) => {
                    if (index === i) {
                        return {
                            ...step,
                            status: "processing",
                            timestamp: new Date().toISOString()
                        };
                    }
                    return step;
                }));

                // Start agent processing
                setAgentOutputs(prev => prev.map((agent, index) => {
                    if (index === i) {
                        return {
                            ...agent,
                            status: "processing",
                            timestamp: new Date().toISOString()
                        };
                    }
                    return agent;
                }));

                // Complete the step and show output after a delay
                setTimeout(() => {
                    setProcessSteps(prev => prev.map((step, index) => {
                        if (index === i) {
                            return {
                                ...step,
                                status: "completed"
                            };
                        }
                        return step;
                    }));

                    // Complete agent output
                    setAgentOutputs(prev => prev.map((agent, index) => {
                        if (index === i) {
                            return {
                                ...agent,
                                status: "completed",
                                output: sampleOutputs[i].output
                            };
                        }
                        return agent;
                    }));

                    // If this is the last step, finish processing and show final recommendation
                    if (i === processSteps.length - 1) {
                        setTimeout(() => {
                            setIsProcessing(false);
                            setFinalRecommendation({
                                action: "BUY",
                                confidence: 82,
                                summary: "Based on comprehensive analysis, our AI committee recommends a BUY position with 82% confidence. Strong technical indicators, positive fundamentals, and favorable market conditions support this decision.",
                                timestamp: new Date().toISOString()
                            });
                        }, 1000);
                    }
                }, 2000 + (i * 300)); // Varying completion times

            }, i * 3000); // Staggered start times
        }

        // Call the parent callback if provided
        if (onRequestRecommendation) {
            onRequestRecommendation(strategy);
        }
    };

    const getStatusIcon = (status) => {
        switch (status) {
            case "completed":
                return <CheckCircle size={20} style={{ color: '#10b981' }} />;
            case "processing":
                return <Activity size={20} style={{ color: '#3b82f6' }} className="pulse" />;
            case "error":
                return <AlertCircle size={20} style={{ color: '#ef4444' }} />;
            default:
                return <Clock size={20} style={{ color: '#6b7280' }} />;
        }
    };

    const getStatusColor = (status) => {
        switch (status) {
            case "completed":
                return "#10b981";
            case "processing":
                return "#3b82f6";
            case "error":
                return "#ef4444";
            default:
                return "#6b7280";
        }
    };

    const formatDate = (dateString) => {
        if (!dateString) return "";
        return new Date(dateString).toLocaleString();
    };

    return (
        <div className="strategy-detail-container">
            {/* Header */}
            <div className="strategy-detail-header">
                <button 
                    onClick={onBack}
                    className="back-button"
                >
                    <ArrowLeft size={20} />
                    Back to Dashboard
                </button>
                <h1 className="strategy-detail-title">{strategy.title}</h1>
            </div>

            {/* Three Column Layout with Bottom Panel */}
            <div className="strategy-detail-content">
                {/* Main Row - Three Columns */}
                <div className="strategy-detail-main-row">
                    {/* Left Column - Process Flow */}
                    <div className="process-flow-column">
                        <div className="process-flow-header">
                            <h2>Process Flow</h2>
                            <button 
                                onClick={handleRequestRecommendation}
                                disabled={isProcessing}
                                className="request-recommendation-button"
                            >
                                <Play size={16} />
                                {isProcessing ? "Processing..." : "Request Recommendation"}
                            </button>
                        </div>

                        <div className="process-flow-content">
                            {processSteps.map((step, index) => (
                                <div key={step.id} className="process-step">
                                    <div className="process-step-indicator">
                                        <div 
                                            className="step-number"
                                            style={{ 
                                                backgroundColor: getStatusColor(step.status),
                                                color: step.status === 'pending' ? '#6b7280' : 'white'
                                            }}
                                        >
                                            {step.status === 'pending' ? step.id : getStatusIcon(step.status)}
                                        </div>
                                        {index < processSteps.length - 1 && (
                                            <div 
                                                className="step-connector"
                                                style={{
                                                    backgroundColor: step.status === 'completed' ? '#10b981' : '#374151'
                                                }}
                                            />
                                        )}
                                    </div>
                                    <div className="process-step-content">
                                        <h3 className="step-title">{step.name}</h3>
                                        <p className="step-description">{step.description}</p>
                                        {step.timestamp && (
                                            <span className="step-timestamp">
                                                {step.status === 'processing' ? 'Started: ' : 'Completed: '}
                                                {formatDate(step.timestamp)}
                                            </span>
                                        )}
                                        {step.status === 'processing' && (
                                            <div className="processing-indicator">
                                                <div className="processing-bar">
                                                    <div className="processing-bar-fill"></div>
                                                </div>
                                            </div>
                                        )}
                                    </div>
                                </div>
                            ))}
                        </div>
                    </div>

                    {/* Middle Column - Agent Outputs */}
                    <div className="agent-output-column">
                        <div className="agent-output-header">
                            <h2>AI Agent Outputs</h2>
                        </div>

                        <div className="agent-outputs-container">
                            {agentOutputs.map((agent) => (
                                <div 
                                    key={agent.id} 
                                    className={`agent-output-item ${agent.status}`}
                                >
                                    <div className="agent-output-title">
                                        <h4>
                                            {getStatusIcon(agent.status)}
                                            {agent.name}
                                        </h4>
                                        <span className={`agent-status-badge ${agent.status}`}>
                                            {agent.status}
                                        </span>
                                    </div>

                                    <div className="agent-output-content">
                                        {agent.status === 'processing' ? (
                                            <div className="typing-indicator">
                                                <span>Analyzing</span>
                                                <div className="typing-dots">
                                                    <div className="typing-dot"></div>
                                                    <div className="typing-dot"></div>
                                                    <div className="typing-dot"></div>
                                                </div>
                                            </div>
                                        ) : agent.output ? (
                                            <pre style={{ 
                                                whiteSpace: 'pre-wrap', 
                                                fontFamily: 'inherit',
                                                margin: 0 
                                            }}>
                                                {agent.output}
                                            </pre>
                                        ) : (
                                            <div className="agent-output-content empty">
                                                Waiting for analysis to begin...
                                            </div>
                                        )}
                                    </div>

                                    {agent.timestamp && (
                                        <div className="agent-output-timestamp">
                                            {agent.status === 'processing' ? 'Started: ' : 'Completed: '}
                                            {formatDate(agent.timestamp)}
                                        </div>
                                    )}
                                </div>
                            ))}
                        </div>
                    </div>

                    {/* Right Column - Strategy Info */}
                    <div className="strategy-info-column">
                        <div className="strategy-info-card">
                            <h3>Strategy Overview</h3>

                            <div className="strategy-info-details">
                                <div className="info-item">
                                    <div className="info-label">
                                        <Coins size={16} />
                                        Asset
                                    </div>
                                    <div className="info-value">{strategy.coin}</div>
                                </div>

                                <div className="info-item">
                                    <div className="info-label">
                                        <DollarSign size={16} />
                                        Amount
                                    </div>
                                    <div className="info-value">
                                        {strategy.currentAmount} {strategy.coin}
                                    </div>
                                </div>

                                <div className="info-item">
                                    <div className="info-label">
                                        <TrendingUp size={16} />
                                        Status
                                    </div>
                                    <div className="info-value">
                                        <span 
                                            className="status-badge"
                                            style={{
                                                backgroundColor: strategy.status === 'active' ? '#10b981' : 
                                                                strategy.status === 'paused' ? '#f59e0b' : '#ef4444',
                                                color: 'white',
                                                padding: '4px 8px',
                                                borderRadius: '12px',
                                                fontSize: '12px',
                                                textTransform: 'capitalize'
                                            }}
                                        >
                                            {strategy.status}
                                        </span>
                                    </div>
                                </div>

                                <div className="info-item">
                                    <div className="info-label">
                                        <Clock size={16} />
                                        Created
                                    </div>
                                    <div className="info-value">
                                        {formatDate(strategy.createdAt)}
                                    </div>
                                </div>
                            </div>

                            <div className="strategy-description-section">
                                <h4>Description</h4>
                                <p className="strategy-description-text">
                                    {strategy.description}
                                </p>
                            </div>

                            {/* Last Recommendation */}
                            {strategy.lastObeyedRecommendation && 
                             strategy.lastObeyedRecommendation.message !== "No recommendations followed yet" && (
                                <div className="last-recommendation">
                                    <h4>Last Recommendation</h4>
                                    <div className="recommendation-content">
                                        <p>{strategy.lastObeyedRecommendation.message}</p>
                                        <div className="recommendation-meta">
                                            <span 
                                                className="recommendation-type"
                                                style={{
                                                    color: strategy.lastObeyedRecommendation.recommendation === 'buy' ? '#10b981' :
                                                           strategy.lastObeyedRecommendation.recommendation === 'sell' ? '#ef4444' : '#f59e0b'
                                                }}
                                            >
                                                {(strategy.lastObeyedRecommendation.recommendation || '').toUpperCase()}
                                            </span>
                                            <span className="recommendation-date">
                                                {formatDate(strategy.lastObeyedRecommendation.timestamp)}
                                            </span>
                                        </div>
                                    </div>
                                </div>
                            )}
                        </div>
                    </div>
                </div>

                {/* Bottom Panel - Final Output Display */}
                <div className="strategy-detail-bottom-panel">
                    <div className="final-output-panel">
                        <div className="final-output-header">
                            <h2>
                                <Target size={24} />
                                Final Investment Recommendation
                            </h2>
                            <div className={`final-output-status ${finalRecommendation ? 'ready' : 'waiting'}`}>
                                {finalRecommendation ? (
                                    <>
                                        <CheckCircle size={16} />
                                        Ready
                                    </>
                                ) : (
                                    <>
                                        <Clock size={16} />
                                        Waiting for Analysis
                                    </>
                                )}
                            </div>
                        </div>

                        {finalRecommendation ? (
                            <div className="final-output-content">
                                {/* Left Side - Recommendation Decision */}
                                <div className="final-recommendation-card">
                                    <h3>
                                        <Zap size={20} />
                                        Investment Decision
                                    </h3>

                                    <div className="recommendation-decision">
                                        <div className={`decision-action ${finalRecommendation.action.toLowerCase()}`}>
                                            {finalRecommendation.action}
                                        </div>
                                        <div className="decision-confidence">
                                            <span className="confidence-score">
                                                {finalRecommendation.confidence}%
                                            </span>
                                            <div className="confidence-label">Confidence</div>
                                        </div>
                                    </div>

                                    <p className="recommendation-summary-text">
                                        {finalRecommendation.summary}
                                    </p>

                                    <div className="recommendation-metrics">
                                        <div className="metric-item">
                                            <div className="metric-label">Risk Level</div>
                                            <div className="metric-value">Moderate</div>
                                        </div>
                                        <div className="metric-item">
                                            <div className="metric-label">Time Horizon</div>
                                            <div className="metric-value">3-6 Months</div>
                                        </div>
                                        <div className="metric-item">
                                            <div className="metric-label">Expected Return</div>
                                            <div className="metric-value">8-15%</div>
                                        </div>
                                        <div className="metric-item">
                                            <div className="metric-label">Position Size</div>
                                            <div className="metric-value">15%</div>
                                        </div>
                                    </div>
                                </div>

                                {/* Right Side - Execution Plan */}
                                <div className="execution-plan-card">
                                    <h3>
                                        <Activity size={20} />
                                        Execution Plan
                                    </h3>

                                    <ul className="execution-steps">
                                        <li className="execution-step">
                                            <div className="step-number-badge">1</div>
                                            <div className="step-content">
                                                <div className="step-title">Entry Strategy</div>
                                                <div className="step-description">
                                                    Enter position at current market levels around $45,230. 
                                                    Consider dollar-cost averaging over 2-3 days.
                                                </div>
                                            </div>
                                        </li>
                                        <li className="execution-step">
                                            <div className="step-number-badge">2</div>
                                            <div className="step-content">
                                                <div className="step-title">Risk Management</div>
                                                <div className="step-description">
                                                    Set stop-loss at $42,000 (-7% from entry) to limit downside risk.
                                                </div>
                                            </div>
                                        </li>
                                        <li className="execution-step">
                                            <div className="step-number-badge">3</div>
                                            <div className="step-content">
                                                <div className="step-title">Profit Taking</div>
                                                <div className="step-description">
                                                    Take partial profits at $50,000 (+10%) and $52,800 (+17%) levels.
                                                </div>
                                            </div>
                                        </li>
                                        <li className="execution-step">
                                            <div className="step-number-badge">4</div>
                                            <div className="step-content">
                                                <div className="step-title">Monitoring</div>
                                                <div className="step-description">
                                                    Monitor key support/resistance levels and reassess monthly.
                                                </div>
                                            </div>
                                        </li>
                                    </ul>
                                </div>
                            </div>
                        ) : (
                            <div className="final-output-content">
                                <div style={{ 
                                    gridColumn: '1 / -1',
                                    textAlign: 'center', 
                                    padding: '40px',
                                    color: '#9ca3af'
                                }}>
                                    <Clock size={48} style={{ marginBottom: '16px', opacity: 0.5 }} />
                                    <h3 style={{ marginBottom: '8px', color: '#d1d5db' }}>
                                        Waiting for AI Analysis
                                    </h3>
                                    <p>
                                        Click "Request Recommendation" to start the analysis process. 
                                        The final recommendation will appear here once all agents complete their analysis.
                                    </p>
                                </div>
                            </div>
                        )}

                        {finalRecommendation && (
                            <div className="final-output-timestamp">
                                Analysis completed on {formatDate(finalRecommendation.timestamp)}
                            </div>
                        )}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default StrategyDetailView;
